happyUpper.code:
func happyUpper(s string) string {
	return strings.ToUpper(s) + "😊"
}

TestHappyUpper.code:
func TestHappyUpper(t *testing.T) {
	var testCases = []struct {
		input	string
		want	string
	}{{"low", "LOW😊"}, {"l", "L😊"}, {"1234", "1234😊"}, {"", "😊"}}
	for _, tc := range testCases {
		have := happyUpper(tc.input)
		if have != tc.want {
			t.Errorf("Error. Want %s have %s", tc.want, have)
		}
	}
}

startGrpcServer.code:
func startGrpcServer() {
	ln, err := net.Listen("tcp", port)
	if err != nil {
		log.Fatalf("❌ Error listening to interfaces. %v ", err)
	}
	log.Println("👂 Server is listening on port", port)
	log.Printf("💡 Server's name is %s", serverName)
	grpcServer := grpc.NewServer()
	srv := &server{Name: serverName}
	zbConfig := zbutil.Config(srv.Name)
	zbutil.InitZBIO(zbConfig)
	message := zb.Message{TopicName: zbutil.TopicName, Data: []byte(fmt.Sprintf("Application grpc-server starting. zbClientName: %s\n", srv.Name)), HintPartition: ""}
	zbutil.SendMessageToZBIO([]zb.Message{message})
	api.RegisterProcessTextServer(grpcServer, srv)
	grpc_health_v1.RegisterHealthServer(grpcServer, &Health{})
	reflection.Register(grpcServer)
	err = grpcServer.Serve(ln)
	if err != nil {
		log.Fatalf("❌ Error setting up the server. %v ", err)
	}
}
